// import components
// utils
import PublicRoute from "../utils/PublicRoute.js";
import { Card2 } from "../utils/cards.js";

// import data
import { work } from "./data";

const WorkItem = () => {
  const itemName = location.pathname.substring(6, location.pathname.length);
  let item = work.filter((i) => i.title === itemName);
  item = item[0];

  const content = (
    <div className="work-item">
      <Card2
        details={item.details}
        image={item.image}
        logos={item.logos}
        subtitle={item.subtitle}
        title={item.title}
      />
    </div>
  );

  return <PublicRoute content={content} />;
};

export default WorkItem;
